//neural net with one hidden layer; sigmoid for hidden, softmax for output
async function nn(data, weights12, bias2, w23, bias3) {
  // just some incomplete sanity checks to find the most obvious errors
  if (!Array.isArray(data) || data.length == 0 ||
      !Array.isArray(weights12) || weights12.length == 0 || !Array.isArray(weights12[0]) || data.length != weights12[0].length || !Array.isArray(bias2) || bias2.length != weights12.length ||
      !Array.isArray(w23) || w23.length == 0 || !Array.isArray(w23[0]) || weights12.length != w23[0].length || !Array.isArray(bias3) || bias3.length != w23.length) {
      console.error('nn(): invalid parameters');
      console.log('d: '+data.length+', weights12: '+weights12.length+', weights12[0]: '+weights12[0].length+', bias2: '+bias2.length+
                  ', w23: '+w23.length+', w23[0]: '+w23[0].length+', bias3: '+bias3.length);
      return undefined;
  }
  var t1 = new Date();
  // compute layer2 output
  var out2 = [];
  for (var i=0; i<weights12.length; i++) {
    out2[i] = bias2[i];
    for (var j=0; j<weights12[i].length; j++) {
      out2[i] += data[j] * weights12[i][j];
    }
    out2[i] = 1 / (1 + Math.exp(-out2[i]));
  }

  //compute layer3 activation
  var out3 = [];
  for (var i=0; i<w23.length; i++) {
    out3[i] = bias3[i];
    for (var j=0; j<w23[i].length; j++) {
      out3[i] += out2[j] * w23[i][j];
    }
  }

  
  let elem = showProcessing('#layer2');
  await delay();
  clearProcessing(elem);
  Plot(out2.slice(4),14,"#layer2"); // 14
  console.log("hello2")
  // compute layer3 output (softmax)
  var max3 = out3.reduce(function(p,c) { return p>c ? p : c; });
  var nominators = out3.map(function(e) { return Math.exp(e - max3); });
  
  var denominator = nominators.reduce(function (p, c) { return p + c; });
  var output = nominators.map(function(e) { return e / denominator; });
  

  // timing measurement
  var dt = new Date() - t1; console.log('NN time: '+dt+'ms');
  console.log("nnOutput: ", output);
  console.log("nnOutput length: " + output.length);
  var maxIndex = 0;
  output.reduce((p,c,i) => {
    if(p<c){
      maxIndex=i; 
      return c;
    } 
    else
      return p;
  });

  elem = showProcessing('#layer3');
  await delay();
  clearProcessing(elem);
  Plot_Softmax(output.slice(0),1,"#layer3");

  return maxIndex;
}

// computes center of mass of digit, for centering
// note 1 stands for black (0 white) so we have to invert.
function centerIm(img) {
  var meanX = 0;
  var meanY = 0;
  var rows = img.length;
  var columns = img[0].length;
  var sumPixels = 0;
  for (var y = 0; y < rows; y++) {
    for (var x = 0; x < columns; x++) {
      var pixel = (1 - img[y][x]);
      sumPixels += pixel;
      meanY += y * pixel;
      meanX += x * pixel;
    }
  }
  meanX /= sumPixels;
  meanY /= sumPixels;
  
  var dY = Math.round(rows/2 - meanY);
  var dX = Math.round(columns/2 - meanX);
  return {transX: dX, transY: dY};
}

// given grayscale image, find bounding rectangle of digit defined
// by above-threshold surrounding
function getBoundingRectangle(img, threshold) {
  var rows = img.length;
  var columns = img[0].length;
  var minX=columns;
  var minY=rows;
  var maxX=-1;
  var maxY=-1;
  for (var y = 0; y < rows; y++) {
    for (var x = 0; x < columns; x++) {
      if (img[y][x] < threshold) {
        if (minX > x) minX = x;
        if (maxX < x) maxX = x;
        if (minY > y) minY = y;
        if (maxY < y) maxY = y;
      }
    }
  }
  return { minY: minY, minX: minX, maxY: maxY, maxX: maxX};
}

// take canvas image and convert to grayscale
// resizing and translating is better done with the canvas functions
function imageDataToGrayscale(imgData) {
  var grayscaleImg = [];
  for (var y = 0; y < imgData.height; y++) {
    grayscaleImg[y]=[];
    for (var x = 0; x < imgData.width; x++) {
      var offset = y * 4 * imgData.width + 4 * x;
      var alpha = imgData.data[offset+3];
      // weird: when painting with stroke, alpha == 0 means white;
      // alpha > 0 is a grayscale value; in that case I simply take the R value
      if (alpha == 0) {
        imgData.data[offset] = 255;
        imgData.data[offset+1] = 255;
        imgData.data[offset+2] = 255;
      }
      imgData.data[offset+3] = 255;
      // simply take red channel value. Not correct, but works for
      // black or white images.
      grayscaleImg[y][x] = imgData.data[y*4*imgData.width + x*4 + 0] / 255;
    }
  }
  return grayscaleImg;
}

// takes the image in the canvas, centers & resizes it, then puts into 10x10 px bins
// to give a 28x28 grayscale image; then, computes class probability via neural network
function recognize() {
  var t1 = new Date();
  
  // convert RGBA image to a grayscale array, then compute bounding rectangle and center of mass  
  var imgData = ctx.getImageData(0, 0, 280, 280);
  console.log("image Data",imgData)
  grayscaleImg = imageDataToGrayscale(imgData);
  console.log("gray Image: ", grayscaleImg)
  var boundingRectangle = getBoundingRectangle(grayscaleImg, 0.01);
  var trans = centerIm(grayscaleImg); // [dX, dY] to center of mass
  
  // copy image to hidden canvas, translate to center-of-mass, then
  // scale to fit into a 200x200 box
  var canvasCopy = document.createElement("canvas");
  canvasCopy.width = imgData.width;
  canvasCopy.height = imgData.height;
  var copyCtx = canvasCopy.getContext("2d");
  var brW = boundingRectangle.maxX+1-boundingRectangle.minX;
  var brH = boundingRectangle.maxY+1-boundingRectangle.minY;
  var scaling = 190 / (brW>brH?brW:brH);
  // scale
  copyCtx.translate(canvas.width/2, canvas.height/2);
  copyCtx.scale(scaling, scaling);
  copyCtx.translate(-canvas.width/2, -canvas.height/2);
  // translate to center of mass
  copyCtx.translate(trans.transX, trans.transY);
  
  // redraw the image with a scaled lineWidth first
  for (var p = 0; p < paths.length; p++) {
    for (var i = 0; i < paths[p][0].length - 1; i++) {
      var x1 = paths[p][0][i];
      var y1 = paths[p][1][i];
      var x2 = paths[p][0][i+1];
      var y2 = paths[p][1][i+1];
      draw(copyCtx, color, lineWidth / scaling, x1, y1, x2, y2);
    }
  }

  // bin the input image of the canvas into 10*10 blocks (giving a 28x28)
  imgData = copyCtx.getImageData(0, 0, 280, 280);
  grayscaleImg = imageDataToGrayscale(imgData);
  var nnInput = new Array(784);
  for (var y = 0; y < 28; y++) {
    for (var x = 0; x < 28; x++) {
      var mean = 0;
      for (var v = 0; v < 10; v++) {
        for (var h = 0; h < 10; h++) {
          mean += grayscaleImg[y*10 + v][x*10 + h];
        }
      }
      mean = (1 - mean / 100); // average and invert
      nnInput[x*28+y] = (mean - .5) / .5;
    }
  }


  // plotting the preprocessed input in visualize.js
  Plot_Input(nnInput, ctx);
  // Plot(nnInput, 28, '#input_layer_canvas');

  // for debugging
  var maxIndex = 0;
  nn(nnInput, weights12, bias2, w23, bias3).then(max => {

    maxIndex = max;
    document.getElementById('nnOut').innerHTML=maxIndex;
    clearBeforeDraw = true;
    var dt = new Date() - t1;
    console.log('recognize time: '+dt+'ms');
  });
}
    
function init() {
    canvas = document.getElementById('can');
    ctx = canvas.getContext("2d");

    canvas.addEventListener("mousemove", function (e) {
        findxy('move', e)
    }, false);
    canvas.addEventListener("mousedown", function (e) {
        findxy('down', e)
    }, false);
    canvas.addEventListener("mouseup", function (e) {
        findxy('up', e)
    }, false);
    canvas.addEventListener("mouseout", function (e) {
        findxy('out', e)
    }, false);
}

function draw(ctx, color, lineWidth, x1, y1, x2, y2) {
    ctx.beginPath();
    ctx.strokeStyle = color;
    ctx.lineWidth = lineWidth;
    ctx.lineCap = 'round';
    ctx.lineJoin = 'round';
    ctx.moveTo(x1, y1);
    ctx.lineTo(x2, y2);
    ctx.stroke();
    ctx.closePath();
}

function erase() {
  let inputLayerCtx = document.getElementById('input_layer_canvas').getContext('2d');
  inputLayerCtx.clearRect(0, 0, canvas.width, canvas.height);

    ctx.clearRect(0, 0, canvas.width, canvas.height);
    document.getElementById('nnOut').innerHTML = '';
    document.getElementById('layer3').innerHTML = '';
    document.getElementById('layer2').innerHTML = ''; 
}

function findxy(res, e) {
    if (res == 'down') {
        if (clearBeforeDraw == true) {
          ctx.clearRect(0,0,canvas.width,canvas.height);
          document.getElementById('nnInput').innerHTML='';
          //document.getElementById('nnOut').innerHTML='';
          paths = [];
          clearBeforeDraw = false;
        }
        
        if (e.pageX != undefined && e.pageY != undefined) {
          currX = e.pageX-canvas.offsetLeft;
          currY = e.pageY-canvas.offsetTop;
        } else {
          currX = e.clientX + document.body.scrollLeft
                  + document.documentElement.scrollLeft
                  - canvas.offsetLeft;
          currY = e.clientY + document.body.scrollTop
                  + document.documentElement.scrollTop
                  - canvas.offsetTop;
        }
        //draw a circle
        ctx.beginPath();
        ctx.lineWidth = 1;
        ctx.arc(currX,currY,lineWidth/2,0,2*Math.PI);
        ctx.stroke();
        ctx.closePath();
        ctx.fill();
        
        paths.push([[currX], [currY]]);
        paintFlag = true;
    }
    if (res == 'up' || res == "out") {
        paintFlag = false;
    }
    
    if (res == 'move') {
        if (paintFlag) {
            // draw a line to previous point
            prevX = currX;
            prevY = currY;
            if (e.pageX != undefined && e.pageY != undefined) {
              currX = e.pageX-canvas.offsetLeft;
              currY = e.pageY-canvas.offsetTop;
            } else {
              currX = e.clientX + document.body.scrollLeft
                      + document.documentElement.scrollLeft
                      - canvas.offsetLeft;
              currY = e.clientY + document.body.scrollTop
                      + document.documentElement.scrollTop
                      - canvas.offsetTop;
            }
            currPath = paths[paths.length-1];
            currPath[0].push(currX);
            currPath[1].push(currY);
            paths[paths.length-1] = currPath;
            draw(ctx, color, lineWidth, prevX, prevY, currX, currY);
        }
    }
}
init();